0026ptype=f_view\\u0026random=855802624\\u0026utuid=97k3hlbE-1rVN8y56zyEEA\",\"elapsedMediaTimeSeconds\":0},\"googleRemarketingUrl\":{\"baseUrl\":\"https:\/\/www.google.com\/pagead\/1p-user-list\/962985656\/?backend=innertube\\u0026cname=1\\u0026cver=2_20200617\\u0026data=backend%3Dinnertube%3Bcname%3D1%3Bcver%3D2_20200617%3Bptype%3Df_view%3Btype%3Dview%3Butuid%3D97k3hlbE-1rVN8y56zyEEA%3Butvid%3DxV6G3-HNfMg\\u0026is_vtc=0\\u0026ptype=f_view\\u0026random=906081266\\u0026utuid=97k3hlbE-1rVN8y56zyEEA\",\"elapsedMediaTimeSeconds\":0}},\"videoDetails\":{\"videoId\":\"xV6G3-HNfMg\",\"title\":\"Figure Dynasty: How Nicole Wilkins Won Her Fourth Olympia - Bodybuilding.com\",\"lengthSeconds\":\"996\",\"keywords\":[\"bodybuilding.com\",\"how-to\",\"how to\",\"bodybuilding motivation\",\"bodybuilding\",\"motivation\",\"fitness\",\"workout\",\"workouts\",\"exercise\",\"exercises\",\"build muscle\",\"Nicole Wilkins-Lee (Person)\",\"Nicole Wilkins\",\"Fitness And Figure Competition (Sport)\",\"Fitness Professional (Profession)\",\"Mr. Olympia (Recurring Competition)\",\"Weight Training (Hobby)\",\"Muscle\",\"Bodybuilder\",\"Muscles\",\"Orleans Arena (Sports Facility)\",\"The Orleans (Accommodation)\",\"female fitness motivation\",\"female fitness\",\"ifbb figure pro\"],\"channelId\":\"UC97k3hlbE-1rVN8y56zyEEA\",\"isOwnerViewing\":false,\"shortDescription\":\"See The Whole Feature: http:\/\/bbcom.me\/1S4oEdj\\n\\nYou've seen her dominate the Figure category on stage. Now get an exclusive look what it's like to compete as four-time Olympia winner Nicole Wilkins.\\n\\nWhen Nicole Wilkins graced the stage at the 2014 Olympia, she came in as a seasoned pro. As she stood under the hot, beaming lights—eager to make history with her fourth Figure and first back-to-back Olympia win—she heard nothing. The roar of the crowd fell silent, and the audience's cheers were put on mute. For that single moment, everything came together for the returning champ. Focus was key.\\n\\n\\\"I thought, 'Walk slow, don't trip, hit your poses the way you need to hold them, make sure you're twisting enough, make sure your chest is lifted enough, make sure you're smiling,'\\\" Nicole says. \\\"I think you're so focused on what you're doing in that moment. Everything else is sort of silent. Even when they announce your name as the winner, it's all you hear. It's just you and the lights.\\\"\\n\\nNicole Wilkins spoke with Bodybuilding.com about what it was like to compete at the 2014 Olympia, and shared her thoughts on the role figure competition has played in her life.\\n\\nTWO DAYS BEFORE FINALS\\nFor Figure competitors—or any Olympia competitor for that matter—the competition is about presenting a perfect package on stage, even if things behind the scenes are a little more complicated. \\\"Winning my first Olympia was amazing, but to then lose it and have the motivation to keep going after a divorce was difficult,\\\" Nicole says. \\\"I mean, those are extreme highs and lows, but every one of those steps and every one of those moments has led up to this.\\\"\\n\\nThe week before the Olympia may be taxing for some but, despite the occasional bout of butterflies—to be expected when defending a title and standing in front of the world in a posing suit—Nicole says it was like the calm before the storm. \\\"With the hard work behind me, it's just about enjoying the moment and having fun.\\\"\\n\\nPart of that fun happened during the first night of the O at \\\"Meet The Olympians,\\\" where competitors met fans and signed autographs. It was a place where the size of the crowd at your booth was a sign of your popularity and recognition in the field. \\\"I remember the first year I was there,\\\" Nicole says. \\\"I didn't have any line at all. I thought, 'Wouldn't it be awesome to have a line of people who actually knew who I was?'\\\" This year, she had just that.\\n\\n\\\"It's exciting to know you have that big [of] an impact on people that you never even met before\\\" she says. \\\"I deal with women who've lost 100 pounds or guys who have lost 100 pounds or quit smoking, and they want to tell you about all the positive changes they've made in their life. That's when the reality sets in that you have a huge impact and affect people more than you realize.\\\"\\n\\nIt's a level of notoriety Nicole still hasn't gotten used to, and something she never takes for granted. \\\"I'm always hoping people will still want to see me,\\\" she says. \\\"I'm hoping that people want to talk to me and come up to my booth. I don't think I'll ever get to a point where I'll expect that. To me, it's very humbling. I'm just doing what I love.\\\"\\n\\n\\\"I went into this sport originally because I wanted it to help my career,\\\" she says. \\\"As a personal trainer, I thought it would help my business. I could show people that I could get in good shape too. I still have that mindset.\\\"\\n\\nNicole won't be quitting figure competition anytime soon. \\\"When you're number one at this, you want to stay number one,\\\" she says. \\\"When I feel like I'm not getting that excitement anymore, that's when I'll know it's time to hang up the heels. I don't think I've necessarily reached my full potential yet. I still have room for growth.\\\"\\n\\n\\nBodybuilding.com:\\nSALES \\u0026 SPECIALS: http:\/\/bbcom.me\/1S4oHpj\\nFITNESS ARTICLES: http:\/\/bbcom.me\/1S4oIcR\\n#1 ONLINE SUPPLEMENT STORE: http:\/\/bbcom.me\/1S4oL8L\\nFREE FITNESS PLANS: http:\/\/bbcom.me\/1S4oN0n\\n\\n \\nFollow Us:\\nYOUTUBE: http:\/\/bit.ly\/1RSJFa4\\nFACEBOOK: http:\/\/on.fb.me\/1lomhpr\\nINSTAGRAM: http:\/\/bit.ly\/1LzBxab\\nTWITTER: http:\/\/bit.ly\/1RSJQlL\\nGOOGLE+: http:\/\/bit.ly\/1NRe8qu\\nPINTEREST: http:\/\/bit.ly\/1OOZgY4\\nSPOTIFY: http:\/\/spoti.fi\/1NRebm0\\n \\nWe are Bodybuilding.com. Your transformation is our passion. We are your personal trainer, your nutritionist, your supplement expert, your lifting partner, your support group. We provide the technology, tools and produ me Olympia winner Nicole Wilkins.\\n\\nWhen Nicole Wilkins graced the stage at the 2014 Olympia, she came in as a seasoned pro. As she stood under the hot, beaming lights—eager to make history with her fourth Figure and first back-to-back Olympia win—she heard nothing. The roar of the crowd fell silent, and the audience's cheers were put on mute. For that single moment, everything came together for the returning champ. Focus was key.\\n\\n\\\"I thought, 'Walk slow, don't trip, hit your poses the way you need to hold them, make sure you're twisting enough, make sure your chest is lifted enough, make sure you're smiling,'\\\" Nicole says. \\\"I think you're so focused on what you're doing in that moment. Everything else is sort of silent. Even when they announce your name as the winner, it's all you hear. It's just you and the lights.\\\"\\n\\nNicole Wilkins spoke with Bodybuilding.com about what it was like to compete at the 2014 Olympia, and shared her thoughts on the role figure competition has played in her life.\\n\\nTWO DAYS BEFORE FINALS\\nFor Figure competitors—or any Olympia competitor for that matter—the competition is about presenting a perfect package on stage, even if things behind the scenes are a little more complicated. \\\"Winning my first Olympia was amazing, but to then lose it and have the motivation to keep going after a divorce was difficult,\\\" Nicole says. \\\"I mean, those are extreme highs and lows, but every one of those steps and every one of those moments has led up to this.\\\"\\n\\nThe week before the Olympia may be taxing for some but, despite the occasional bout of butterflies—to be expected when defending a title and standing in front of the world in a posing suit—Nicole says it was like the calm before the storm. \\\"With the hard work behind me, it's just about enjoying the moment and having fun.\\\"\\n\\nPart of that fun happened during the first night of the O at \\\"Meet The Olympians,\\\" where competitors met fans and signed autographs. It was a place where the size of the crowd at your booth was a sign of your popularity and recognition in the field. \\\"I remember the first year I was there,\\\" Nicole says. \\\"I didn't have any line at all. I thought, 'Wouldn't it be awesome to have a line of people who actually knew who I was?'\\\" This year, she had just that.\\n\\n\\\"It's exciting to know you have that big [of] an impact on people that you never even met before\\\" she says. \\\"I deal with women who've lost 100 pounds or guys who have lost 100 pounds or quit smoking, and they want to tell you about all the positive changes they've made in their life. That's when the reality sets in that you have a huge impact and affect people more than you realize.\\\"\\n\\nIt's a level of notoriety Nicole still hasn't gotten used to, and something she never takes for granted. \\\"I'm always hoping people will still want to see me,\\\" she says. \\\"I'm hoping that people want to talk to me and come up to my booth. I don't think I'll ever get to a point where I'll expect that. To me, it's very humbling. I'm just doing what I love.\\\"\\n\\n\\\"I went into this sport originally because I wanted it to help my career,\\\" she says. \\\"As a personal trainer, I thought it would help my business. I could show people that I could get in good shape too. I still have that mindset.\\\"\\n\\nNicole won't be quitting figure competition anytime soon. \\\"When you're number one at this, you want to stay number one,\\\" she says. \\\"When I feel like I'm not getting that excitement anymore, that's when I'll know it's time to hang up the heels. I don't think I've necessarily reached my full potential yet. I still have room for growth.\\\"\\n\\n\\nBodybuilding.com:\\nSALES \\u0026 SPECIALS: http:\/\/bbcom.me\/1S4oHpj\\nFITNESS ARTICLES: http:\/\/bbcom.me\/1S4oIcR\\n#1 ONLINE SUPPLEMENT STORE: http:\/\/bbcom.me\/1S4oL8L\\nFREE FITNESS PLANS: http:\/\/bbcom.me\/1S4oN0n\\n\\n \\nFollow Us:\\nYOUTUBE: http:\/\/bit  category on stage. Now get an exclusive look what it's like to compete as four-time Olympia winner Nicole Wilkins.\n\nWhen Nicole Wilkins graced the stage at the 2014 Olympia, she came in as a seasoned pro. As she stood under the hot, beaming lights—eager to make history with her fourth Figure and first back-to-back Olympia win—she heard nothing. The roar of the crowd fell silent, and the audience's cheers were put on mute. For that single moment, everything came together for the returning champ. Focus was key.\n\n\"I thought, 'Walk slow, don't trip, hit your poses the way you need to hold them, make sure you're twisting enough, make sure your chest is lifted enough, make sure you're smiling,'\" Nicole says. \"I think you're so focused on what you're doing in that moment. Everything else is sort of silent. Even when they announce your name as the winner, it's all you hear. It's just you and the lights.\"\n\nNicole Wilkins spoke with Bodybuilding.com about what it was like to compete at the 2014 Olympia, and shared her thoughts on the role figure competition has played in her life.\n\nTWO DAYS BEFORE FINALS\nFor Figure competitors—or any Olympia competitor for that matter—the competition is about presenting a perfect package on stage, even if things behind the scenes are a little more complicated. \"Winning my first Olympia was amazing, but to then lose it and have the motivation to keep going after a divorce was difficult,\" Nicole says. \"I mean, those are extreme highs and lows, but every one of those steps and every one of those moments has led up to this.\"\n\nThe week before the Olympia may be taxing for some but, despite the occasional bout of butterflies—to be expected when defending a title and standing in front of the world in a posing suit—Nicole says it was like the calm before the storm. \"With the hard work behind me, it's just about enjoying the moment and having fun.\"\n\nPart of that fun happened during the first night of the O at \"Meet The Olympians,\" where competitors met fans and signed autographs. It was a place where the size of the crowd at your booth was a sign of your popularity and recognition in the field. \"I remember the first year I was there,\" Nicole says. \"I didn't have any line at all. I thought, 'Wouldn't it be awesome to have a line of people who actually knew who I was?'\" This year, she had just that.\n\n\"It's exciting to know you have that big [of] an impact on people that you never even met before\" she says. \"I deal with women who've lost 100 pounds or guys who have lost 100 pounds or quit smoking, and they want to tell you about all the positive changes they've made in their life. That's when the reality sets in that you have a huge impact and affect people more than you realize.\"\n\nIt's a level of notoriety Nicole still hasn't gotten used to, and something she never takes for granted. \"I'm always hoping people will still want to see me,\" she says. \"I'm hoping that people want to talk to me and come up to my booth. I don't think I'll ever get to a point where I'll expect that. To me, it's very humbling. I'm just doing what I love.\"\n\n\"I went into this sport originally because I wanted it to help my career,\" she says. \"As a personal trainer, I thought it would help my business. I could show people that I could get in good shape too. I still have that mindset.\"\n\nNicole won't be quitting figure competition anytime soon. \"When you're number one at this, you want to stay number one,\" she says. \"When I feel like I'm not getting that excitement anymore, that's when I'll know it's time to hang up the heels. I don't think I've necessarily reached my full potential yet. I still have room for growth.\"\n\n\nBodybuilding.com:\nSALES \u0026 SPECIALS: "},{"text":"http://bbcom.me/1S4oHpj","navigationEndpoint":{"clickTrackingParams":"CJwBEM2rARgBIhMItZCls8Sa6gIVzSrxBR1YYwUPSMj5tY7-26GvxQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=cKk2stH61MO9aYG0SziRH V6G3-HNfMg","elapsedMediaTimeSeconds":120},"atrUrl":{"baseUrl":"https://s.youtube.com/api/stats/atr?docid=xV6G3-HNfMg\u0026ei=B1LzXoPuF8OyxN8PjZaLoA8\u0026len=996\u0026ns=yt\u0026plid=AAWo1EZppt3THina\u0026ver=2","elapsedMediaTimeSeconds":5},"youtubeRemarketingUrl":{"baseUrl":"https://www.youtube.com/pagead/viewthroughconversion/962985656/?backend=innertube\u0026cname=1\u0026cver=2_20200617\u0026data=backend%3Dinnertube%3Bcname%3D1%3Bcver%3D2_20200617%3Bptype%3Df_view%3Btype%3Dview%3Butuid%3D97k3hlbE-1rVN8y56zyEEA%3Butvid%3DxV6G3-HNfMg\u0026foc_id=97k3hlbE-1rVN8y56zyEEA\u0026label=followon_view\u0026ptype=f_view\u0026random=855802624\u0026utuid=97k3hlbE-1rVN8y56zyEEA","elapsedMediaTimeSeconds":0},"googleRemarketingUrl":{"baseUrl":"https://www.google.com/pagead/1p-user-list/962985656/?backend=innertube\u0026cname=1\u0026cver=2_20200617\u0026data=backend%3Dinnertube%3Bcname%3D1%3Bcver%3D2_20200617%3Bptype%3Df_view%3Btype%3Dview%3Butuid%3D97k3hlbE-1rVN8y56zyEEA%3Butvid%3DxV6G3-HNfMg\u0026is_vtc=0\u0026ptype=f_view\u0026random=906081266\u0026utuid=97k3hlbE-1rVN8y56zyEEA","elapsedMediaTimeSeconds":0}},"videoDetails":{"videoId":"xV6G3-HNfMg","title":"Figure Dynasty: How Nicole Wilkins Won Her Fourth Olympia - Bodybuilding.com","lengthSeconds":"996","keywords":["bodybuilding.com","how-to","how to","bodybuilding motivation","bodybuilding","motivation","fitness","workout","workouts","exercise","exercises","build muscle","Nicole Wilkins-Lee (Person)","Nicole Wilkins","Fitness And Figure Competition (Sport)","Fitness Professional (Profession)","Mr. Olympia (Recurring Competition)","Weight Training (Hobby)","Muscle","Bodybuilder","Muscles","Orleans Arena (Sports Facility)","The Orleans (Accommodation)","female fitness motivation","female fitness","ifbb figure pro"],"channelId":"UC97k3hlbE-1rVN8y56zyEEA","isOwnerViewing":false,"shortDescription":"See The Whole Feature: http://bbcom.me/1S4oEdj\n\nYou've seen her dominate the Figure category on stage. Now get an exclusive look what it's like to compete as four-time Olympia winner Nicole Wilkins.\n\nWhen Nicole Wilkins graced the stage at the 2014 Olympia, she came in as a seasoned pro. As she stood under the hot, beaming lights—eager to make history with her fourth Figure and first back-to-back Olympia win—she heard nothing. The roar of the crowd fell silent, and the audience's cheers were put on mute. For that single moment, everything came together for the returning champ. Focus was key.\n\n\"I thought, 'Walk slow, don't trip, hit your poses the way you need to hold them, make sure you're twisting enough, make sure your chest is lifted enough, make sure you're smiling,'\" Nicole says. \"I think you're so focused on what you're doing in that moment. Everything else is sort of silent. Even when they announce your name as the winner, it's all you hear. It's just you and the lights.\"\n\nNicole Wilkins spoke with Bodybuilding.com about what it was like to compete at the 2014 Olympia, and shared her thoughts on the role figure competition has played in her life.\n\nTWO DAYS BEFORE FINALS\nFor Figure competitors—or any Olympia competitor for that matter—the competition is about presenting a perfect package on stage, even if things behind the scenes are a little more complicated. \"Winning my first Olympia was amazing, but to then lose it and have the motivation to keep going after a divorce was difficult,\" Nicole says. \"I mean, those are extreme highs and lows, but every one of those steps and every one of those moments has led up to this.\"\n\nThe week before the Olympia may be taxing for some but, despite the occasional bout of butterflies—to be expected when defending a title and standing in front of the world in a posing suit—Nicole says it was like the calm before the storm. \"With the hard work behind me, it's just about enjoying the moment and having fun.\"\n\nPart of that fun happened during the first night of the O at \"Meet The Olympians,\" where competitors met fans and signed autographs. It was a place where the size of the crowd at your booth was a sign of your popularity and recognition in the field. \"I remember the first year I was there,\" Nicole says. \"I didn't have any line at all. I thought, 'Wouldn't it be awesome to have a line of people who actually knew who I was?'\" This year, she had just that.\n\n\"It's exciting to know you have that big [of] an impact on people that you never even met before\" she says. \"I deal with women who've lost 100 pounds or guys who have lost 100 pounds or quit smoking, and they want to tell you about all the positive changes they've made in their life. That's when the reality sets in that you have a huge impact and affect people more than you realize.\"\n\nIt's a level of notoriety Nicole still hasn't gotten used to, and something she never takes for granted. \"I'm always hoping people will still want to see me,\" she says. \"I'm hoping that people want to talk to me and come up to my booth. I don't think I'll ever get to a point where I'll expect that. To me, it's very humbling. I'm just doing what I love.\"\n\n\"I went into this sport originally because I wanted it to help my career,\" she says. \"As a personal trainer, I thought it would help my business. I could show people that I could get in good shape too. I still have that mindset.\"\n\nNicole won't be quitting figure competition anytime soon. \"When you're number one at this, you want to stay number one,\" she says. \"When I feel like I'm not getting that excitement anymore, that's when I'll know it's time to hang up the heels. I don't think I've necessarily reached my full potential yet. I still have room for growth.\"\n\n\nBodybuilding.com:\nSALES \u0026 SPECIALS: http://bbcom.me/1S4oHpj\nFITNESS ARTICLES: http://bbcom.me/1S4oIcR\n#1 ONLINE SUPPLEMENT STORE: http://bbcom.me/1S4oL8L\nFREE FITNESS PLANS: http://bbcom.me/1S4oN0n\n\n \nFollow Us:\nYOUTUBE: http://bit.ly/1RSJFa4\nFACEBOOK: http://on.fb.me/1lomhpr\nINSTAGRAM: http://bit.ly/1LzBx ion=3\u0026autohide=1"},"title":{"simpleText":"Figure Dynasty: How Nicole Wilkins Won Her Fourth Olympia - Bodybuilding.com"},"description":{"simpleText":"See The Whole Feature: http://bbcom.me/1S4oEdj\n\nYou've seen her dominate the Figure category on stage. Now get an exclusive look what it's like to compete as four-time Olympia winner Nicole Wilkins.\n\nWhen Nicole Wilkins graced the stage at the 2014 Olympia, she came in as a seasoned pro. As she stood under the hot, beaming lights—eager to make history with her fourth Figure and first back-to-back Olympia win—she heard nothing. The roar of the crowd fell silent, and the audience's cheers were put on mute. For that single moment, everything came together for the returning champ. Focus was key.\n\n\"I thought, 'Walk slow, don't trip, hit your poses the way you need to hold them, make sure you're twisting enough, make sure your chest is lifted enough, make sure you're smiling,'\" Nicole says. \"I think you're so focused on what you're doing in that moment. Everything else is sort of silent. Even when they announce your name as the winner, it's all you hear. It's just you and the lights.\"\n\nNicole Wilkins spoke with Bodybuilding.com about what it was like to compete at the 2014 Olympia, and shared her thoughts on the role figure competition has played in her life.\n\nTWO DAYS BEFORE FINALS\nFor Figure competitors—or any Olympia competitor for that matter—the competition is about presenting a perfect package on stage, even if things behind the scenes are a little more complicated. \"Winning my first Olympia was amazing, but to then lose it and have the motivation to keep going after a divorce was difficult,\" Nicole says. \"I mean, those are extreme highs and lows, but every one of those steps and every one of those moments has led up to this.\"\n\nThe week before the Olympia may be taxing for some but, despite the occasional bout of butterflies—to be expected when defending a title and standing in front of the world in a posing suit—Nicole says it was like the calm before the storm. \"With the hard work behind me, it's just about enjoying the moment and having fun.\"\n\nPart of that fun happened during the first night of the O at \"Meet The Olympians,\" where competitors met fans and signed autographs. It was a place where the size of the crowd at your booth was a sign of your popularity and recognition in the field. \"I remember the first year I was there,\" Nicole says. \"I didn't have any line at all. I thought, 'Wouldn't it be awesome to have a line of people who actually knew who I was?'\" This year, she had just that.\n\n\"It's exciting to know you have that big [of] an impact on people that you never even met before\" she says. \"I deal with women who've lost 100 pounds or guys who have lost 100 pounds or quit smoking, and they want to tell you about all the positive changes they've made in their life. That's when the reality sets in that you have a huge impact and affect people more than you realize.\"\n\nIt's a level of notoriety Nicole still hasn't gotten used to, and something she never takes for granted. \"I'm always hoping people will still want to see me,\" she says. \"I'm hoping that people want to talk to me and come up to my booth. I don't think I'll ever get to a point where I'll expect that. To me, it's very humbling. I'm just doing what I love.\"\n\n\"I went into this sport originally because I wanted it to help my career,\" she says. \"As a personal trainer, I thought it would help my business. I could show people that I could get in good shape too. I still have that mindset.\"\n\nNicole won't be quitting figure competition anytime soon. \"When you're number one at this, you want to stay number one,\" she says. \"When I feel like I'm not getting that excitement anymore, that's when I'll know it's time to hang up the heels. I don't think I've necessarily reached my full potential yet. I still have room for growth.\"\n\n\nBodybuilding.com:\nSALES \u0026 S
